// JavaThreadState keeps track of which part of the code a thread is executing in. This


// information is needed by the safepoint code.


//


// There are 4 essential states:


//


//Â  _thread_newÂ  Â  Â  Â  Â : Just started, but not executed init. code yet (most likely still in OS init code)


//Â  _thread_in_nativeÂ  Â : In native code. This is a safepoint region, since all oops will be in jobject handles


//Â  _thread_in_vmÂ  Â  Â  Â : Executing in the vm


//Â  _thread_in_JavaÂ  Â  Â : Executing either interpreted or compiled Java code (or could be in a stub)


//


// Each state has an associated xxxx_trans state, which is an intermediate state used when a thread is in


// a transition from one state to another. These extra states makes it possible for the safepoint code to


// handle certain thread_states without having to suspend the thread - making the safepoint code faster.


//


// Given a state, the xxxx_trans state can always be found by adding 1.


//


enum JavaThreadState {


_thread_uninitializedÂ  Â  Â =Â  0, // should never happen (missing initialization)


_thread_newÂ  Â  Â  Â  Â  Â  Â  Â =Â  2, // just starting up, i.e., in process of being initialized


_thread_new_transÂ  Â  Â  Â  Â =Â  3, // corresponding transition state (not used, included for completeness)


_thread_in_nativeÂ  Â  Â  Â  Â =Â  4, // running in native code


_thread_in_native_transÂ  Â =Â  5, // corresponding transition state


_thread_in_vmÂ  Â  Â  Â  Â  Â  Â =Â  6, // running in VM


_thread_in_vm_transÂ  Â  Â  Â =Â  7, // corresponding transition state


_thread_in_JavaÂ  Â  Â  Â  Â  Â =Â  8, // running in Java or in stub code


_thread_in_Java_transÂ  Â  Â =Â  9, // corresponding transition state (not used, included for completeness)


_thread_blockedÂ  Â  Â  Â  Â  Â = 10, // blocked in vm


_thread_blocked_transÂ  Â  Â = 11, // corresponding transition state


_thread_max_stateÂ  Â  Â  Â  Â = 12Â  // maximum thread state+1 - used for statistics allocatio
